import { ReactNode } from 'react';
import { Cell, Button, Section } from '@telegram-apps/telegram-ui';

import { Icon28Chat } from '@telegram-apps/telegram-ui/dist/icons/28/chat';

type BannerProps = {
    id: number;
    icon: ReactNode;
    title: string;
    subtitle: string,
}

const banner: BannerProps = {
    id: 1,
    icon: <Icon28Chat />,
    title: 'Петров Иван Федорович',
    subtitle: 'Б24-215',
}

export const MainProfileBanner = () => (
    <Section>
        <Cell
            key={banner.id}
            subtitle={banner.subtitle}
            after={<Button
  mode="outline"
  size="m"
>
  Action
</Button>
            }
        >
            {banner.title}
        </Cell>
        )
    </Section >
);
